  }

  console.log(favList);
  return (
      <section className='favorite'>
        <div className='favorite__wrapper'>
          <h1 className='fafovirte__title'>Your Favorite Destinations:</h1>
          {favList.map(fav => <h2 className='favorite__country' onClick={deleteFav(fav)}>{fav}</h2>)}

        </div>
      </section>
  )
}

export default Favorite;
